import {
  ButtonModels,
  ButtonPrimary,
} from "../../../shared/components/buttons/ButtonPrimary";
import { useEffectLogin } from "../../hooks/login.hooks";
import { handleSubmit } from "./Form.component";
/*         name="Save"
        icon="pi pi-check"
        iconPos="right" */
export const FormHtml = () => {
  const data: ButtonModels = {
    label: "Save",
    icon: "pi pi-check",
    iconsPos: "right",
    handleClick: handleSubmit,
  };
  useEffectLogin();
  return (
    <div>
      <h1>hello Wolrd</h1>
      <ButtonPrimary data={data} />
    </div>
  );
};
